import React, { useContext } from 'react';
import { Center } from '../components/Center';
import { Text, Button, StyleSheet } from 'react-native';
import { AuthContext } from '../AuthProvider';

const Home = () => {
    const {logout} = useContext(AuthContext);
    return (
        <Center>
            <Text>Home</Text>
            <Button 
                title='logout'
                onPress={() => logout()}
            />
        </Center>
    );
}

export default Home;
